import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

const ItineraryDetail = () => {
  const { slug } = useParams();
  const [itinerary, setItinerary] = useState(null);
  const [enquiry, setEnquiry] = useState({
    name: "",
    email: "",
    message: "",
  });
  const [submitted, setSubmitted] = useState(false);

  useEffect(() => {
    axios
      .get(`http://127.0.0.1:8000/api/itineraries/${slug}/`)
      .then((response) => setItinerary(response.data))
      .catch((error) => console.error("Error fetching itinerary:", error));
  }, [slug]);

  const handleChange = (e) => {
    setEnquiry({ ...enquiry, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const payload = {
      itinerary: itinerary.id,
      name: enquiry.name,
      email: enquiry.email,
      message: enquiry.message,
    };

    axios
      .post("http://127.0.0.1:8000/api/enquiries/", payload)
      .then(() => {
        setSubmitted(true);
        setEnquiry({ name: "", email: "", message: "" });
      })
      .catch((error) => {
        console.error("Error submitting enquiry:", error);
        alert("Failed to send enquiry.");
      });
  };

  if (!itinerary) return <p>Loading itinerary details...</p>;

  return (
    <div style={{ padding: "20px" }}>
      <h2>{itinerary.title}</h2>
      <p><strong>Destination:</strong> {itinerary.destination}</p>
      <p><strong>Duration:</strong> {itinerary.duration} days</p>
      <p><strong>Price:</strong> ₹ {itinerary.price}</p>
      <p>{itinerary.description}</p>
      {itinerary.qr_code && (
        <img
          src={`http://127.0.0.1:8000${itinerary.qr_code}`}
          alt="QR Code"
          style={{ width: "200px", marginTop: "10px" }}
        />
      )}

      <hr style={{ margin: "30px 0" }} />

      <h3>Enquiry Form</h3>
      {submitted ? (
        <p style={{ color: "green" }}>Thank you! We’ll get back to you soon.</p>
      ) : (
        <form onSubmit={handleSubmit}>
          <div>
            <label>Name:</label><br />
            <input
              type="text"
              name="name"
              value={enquiry.name}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>Email:</label><br />
            <input
              type="email"
              name="email"
              value={enquiry.email}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label>Message:</label><br />
            <textarea
              name="message"
              value={enquiry.message}
              onChange={handleChange}
              required
            />
          </div>
          <button type="submit" style={{ marginTop: "10px" }}>Send Enquiry</button>
        </form>
      )}
    </div>
  );
};

export default ItineraryDetail;
